INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (1, 3000, 2, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_1_002_001", "調子が上がって\nきたなっ", 2, "vo_minigame_1013_icon_2_002_001", 2, 1000);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (2, 3000, 2, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_1_003_001", "ほらほら、\nまだいけるだろ？", 2, "vo_minigame_1013_icon_2_003_001", 2, 5000);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3, 3000, 2, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001", "へへっ、おまえら\nやるじゃねえか！", 3, "vo_minigame_1013_icon_2_004_001", 2, 10000);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (4, 3000, 3, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001", "あたしたちはまだ\n止まらねえぜ！", 3, "vo_minigame_1013_icon_2_005_001", 2, 10000);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (5, 3000, 3, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_1_005_002", "見てろよ！\nマコト班の快進撃だ！", 3, "vo_minigame_1013_icon_2_005_002", 2, 10000);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (6, 3000, 3, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_1_005_003", "うおぉぉっ！\n絶好調だぜ！", 3, "vo_minigame_1013_icon_2_005_003", 2, 10000);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (7, 3000, 4, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_1_006_001", "どこまで行けるか\n楽しみだなっ！", 3, "vo_minigame_1013_icon_2_006_001", 2, 0);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (8, 1000, 5, "厄介でしたわ…", "vo_minigame_1013_icon_1_007_001", "まだ諦めんなよっ", 4, "vo_minigame_1013_icon_2_007_001", 3, 1);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (9, 1000, 5, "油断大敵です", "vo_minigame_1013_icon_1_007_002", "冷やっとしたぜ…！", 4, "vo_minigame_1013_icon_2_007_002", 3, 1);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (10, 1000, 5, "忌々しいっ…", "vo_minigame_1013_icon_1_007_003", "弱音を吐くなっ", 4, "vo_minigame_1013_icon_2_007_003", 3, 1);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (11, 1500, 6, "大所帯ですわね", "vo_minigame_1013_icon_1_008_001", "マコト班集合！", 3, "vo_minigame_1013_icon_2_008_001", 4, 99);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (12, 1500, 6, "エリコ班へようこそ", "vo_minigame_1013_icon_1_008_002", "連携してくぞ！", 3, "vo_minigame_1013_icon_2_008_002", 4, 99);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (13, 3000, 8, "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_1_020_001", "みんなに力を！", 6, "vo_minigame_1013_icon_2_020_001", 1, 0);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (14, 3000, 9, "はっはっは！\n任せろ！", "vo_minigame_1013_icon_1_022_001", "任せてくれたまえ", 7, "vo_minigame_1013_icon_2_022_001", 1, 0);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (15, 3000, 10, "どんどんいくわよ", "vo_minigame_1013_icon_1_023_001", "ほな、いきまひょか", 8, "vo_minigame_1013_icon_2_023_001", 1, 0);
